import React from "react";
import $ from "jquery";

import "./Button.css";

const Button = props => {

function fade() {
    setInterval(()=> {

        $(`{props.className}`).fadeOut(500).fadeIn(500);
    }, 5000);
    
}

    return (
        <button type="button" className={props.className} onClick={fade}>
            {props.children}
        </button>
    );
};

export default Button;
